import React from 'react';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom'
import './App.css';
import Game from './components/Game'
import {Nav} from './components/Nav'

const App = () => (

        <Router>
            <div className="App">
                <Nav/>
                <Route path="/game" component={Game}/>
            </div>
        </Router>    

)

export default App;
